import { render } from "@testing-library/react";
import React from "react";
import Card from "./Form"

class ContactsList extends React.Component {
    render() {
        return (
            <div className="row">
                {
                    this.props.persons
                    .slice(0, 3)
                    .map(function (person) {
                        return(
                            <Card person={person} />
                        )
                    })
                }
            </div>
        )
    }
}

export default ContactsList;
